Let me think through this step by step...

**Key Psychological Mechanisms Involved:**

1. **Fairness:**  Responders likely evaluate the proposed split based on their perception of fairness.  A simple model of fairness could be based on the ratio of the proposed split to the ratio of contributions.  Absolute amounts may matter less than relative proportions.

2. **Self-Interest:** Responders will ultimately consider their own payoff (split_self).  A more generous offer will generally lead to greater self-interest utility.

**How these Mechanisms Interact:**

Fairness and self-interest likely interact multiplicatively. A fair offer might be accepted even if the absolute payoff is modest, while an unfair but lucrative offer might still be rejected if the perceived injustice is strong enough.

**Mathematical Form:**

A multiplicative model would capture this interaction well. We can define a fairness index based on the ratio of earned tokens, and then weight the self-interest component by this fairness index.

**Parameters Needed:**

1. **Fairness Weight (fairness_weight):** This parameter reflects the importance of fairness relative to self-interest. A higher value indicates a stronger preference for fairness.  This parameter should be positive to model acceptance behaviour.
2. **Self-Interest Sensitivity (self_interest_sensitivity):**  This parameter captures the sensitivity of the responder to changes in their own monetary payoff.  This should be positive to model acceptance behaviour.


**How Model Variables Map to Observable Behavior:**

The model will predict the utility of accepting an offer.  A higher utility suggests a greater likelihood of acceptance. The model uses the ratio of tokens as a proxy for fairness, and the monetary value of the offer as a proxy for self-interest.

<MODEL>
U = fairness_weight * (split_self / combined_earning) / ((token_self + token_opp)/token_self) + self_interest_sensitivity * split_self 
</MODEL>

